import React from "react";
import logo from "../assets/img/logo.png";

export const DrawerMenu: React.FC = () => {
  return (
    <div className="w-1/5 h-screen bg-slate-100 drop-shadow-xl p-6">
      <div className="flex items-center space-x-2">
        <img className="w-14" src={logo} alt="Logo" />
        <span className="text-2xl font-bold text-[#0E5F9A]">Biblio</span>
        <span className="text-2xl font-bold text-[#0E5F9A]">Tech</span>
      </div>
    </div>
  );
};
